package com.zili.oj;

import org.junit.Test;

import java.util.Arrays;

import static org.junit.Assert.*;

public class LC_0942_di_str_matchTest {

    @Test
    public void diStringMatch() {
        LC_0942_di_str_match o = new LC_0942_di_str_match();

        String s;

        s="I";
        assertTrue(verify(o.diStringMatch(s), s));
        s="D";
        assertTrue(verify(o.diStringMatch(s), s));
        s="III";
        assertTrue(verify(o.diStringMatch(s), s));
        s="DDD";
        assertTrue(verify(o.diStringMatch(s), s));
        s="DIDI";
        assertTrue(verify(o.diStringMatch(s), s));
        s="IDID";
        assertTrue(verify(o.diStringMatch(s), s));
        s="DIIIDDIDDDDDDDDIDIDI";
        assertTrue(verify(o.diStringMatch(s), s));
        s = "";
        assertTrue(verify(o.diStringMatch(s), s));
    }

    private boolean verify(int[] a, String s) {
//        System.out.printf("verifying: %s %s\n", Arrays.toString(a),s);
        for (int i = 0; i < s.length(); i++) {
            char c = s.charAt(i);
            if (c == 'I') {
                if (a[i] > a[i + 1]) {
                    return false;
                }
            } else {
                if (a[i] < a[i + 1]) {
                    return false;
                }
            }
        }
        return true;
    }

}
